<ytd-compact-video-renderer
  class="style-scope ytd-item-section-renderer"
  thumbnail-width="168"
  lockup="true"
  ><!--css-build:shady-->
  <div id="dismissible" class="style-scope ytd-compact-video-renderer">
    <ytd-thumbnail
      use-hovered-property=""
      class="style-scope ytd-compact-video-renderer"
      ><!--css-build:shady--><a
        id="thumbnail"
        class="yt-simple-endpoint inline-block style-scope ytd-thumbnail"
        aria-hidden="true"
        tabindex="-1"
        rel="nofollow"
        href="/watch?v=W4d68R50amc"
      >
        <yt-image
          alt=""
          ftl-eligible=""
          class="style-scope ytd-thumbnail"
          disable-upgrade=""
          hidden=""
        >
        </yt-image>
        <yt-img-shadow
          ftl-eligible=""
          class="style-scope ytd-thumbnail no-transition"
          style="background-color: transparent"
          loaded=""
          ><!--css-build:shady--><img
            id="img"
            class="style-scope yt-img-shadow"
            alt=""
            width="168"
            src="https://i.ytimg.com/vi/W4d68R50amc/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==&amp;rs=AOn4CLCBDAl0wAmbWINWyIQcKBvw3d2axg"
        /></yt-img-shadow>

        <div id="overlays" class="style-scope ytd-thumbnail">
          <ytd-thumbnail-overlay-time-status-renderer
            class="style-scope ytd-thumbnail"
            overlay-style="DEFAULT"
            ><!--css-build:shady--><yt-icon
              class="style-scope ytd-thumbnail-overlay-time-status-renderer"
              disable-upgrade=""
              hidden=""
            ></yt-icon
            ><span
              id="text"
              class="style-scope ytd-thumbnail-overlay-time-status-renderer"
              aria-label="14 minutes, 49 seconds"
            >
              14:49
            </span></ytd-thumbnail-overlay-time-status-renderer
          ><ytd-thumbnail-overlay-now-playing-renderer
            class="style-scope ytd-thumbnail"
            ><!--css-build:shady--><span
              class="style-scope ytd-thumbnail-overlay-now-playing-renderer"
              >Now playing</span
            >
            <ytd-thumbnail-overlay-equalizer
              class="style-scope ytd-thumbnail-overlay-now-playing-renderer"
              ><!--css-build:shady--><svg
                xmlns="http://www.w3.org/2000/svg"
                id="equalizer"
                viewBox="0 0 55 95"
                class="style-scope ytd-thumbnail-overlay-equalizer"
              >
                <g class="style-scope ytd-thumbnail-overlay-equalizer">
                  <rect
                    class="bar style-scope ytd-thumbnail-overlay-equalizer"
                    x="0"
                  ></rect>
                  <rect
                    class="bar style-scope ytd-thumbnail-overlay-equalizer"
                    x="20"
                  ></rect>
                  <rect
                    class="bar style-scope ytd-thumbnail-overlay-equalizer"
                    x="40"
                  ></rect>
                </g>
              </svg>
            </ytd-thumbnail-overlay-equalizer>
          </ytd-thumbnail-overlay-now-playing-renderer>
        </div>
        <div id="mouseover-overlay" class="style-scope ytd-thumbnail"></div>
        <div id="hover-overlays" class="style-scope ytd-thumbnail"></div>
      </a>
    </ytd-thumbnail>
    <div class="details style-scope ytd-compact-video-renderer">
      <div class="metadata style-scope ytd-compact-video-renderer">
        <a
          class="yt-simple-endpoint style-scope ytd-compact-video-renderer"
          rel="nofollow"
          href="/watch?v=W4d68R50amc"
        >
          <h3 class="style-scope ytd-compact-video-renderer">
            <ytd-badge-supported-renderer
              class="style-scope ytd-compact-video-renderer"
              disable-upgrade=""
              hidden=""
            >
            </ytd-badge-supported-renderer>
            <span
              id="video-title"
              class="style-scope ytd-compact-video-renderer"
              aria-label="Health And Safety  - The Office US by The Office 2 years ago 14 minutes, 49 seconds 6,009,171 views"
              title="Health And Safety  - The Office US"
            >
              Health And Safety - The Office US
            </span>
          </h3>
          <div
            class="secondary-metadata style-scope ytd-compact-video-renderer"
          >
            <ytd-video-meta-block
              class="compact style-scope ytd-compact-video-renderer"
              no-endpoints=""
              ><!--css-build:shady-->
              <div id="metadata" class="style-scope ytd-video-meta-block">
                <div
                  id="byline-container"
                  class="style-scope ytd-video-meta-block"
                >
                  <ytd-channel-name
                    id="channel-name"
                    class="style-scope ytd-video-meta-block"
                    ><!--css-build:shady-->
                    <div id="container" class="style-scope ytd-channel-name">
                      <div
                        id="text-container"
                        class="style-scope ytd-channel-name"
                      >
                        <yt-formatted-string
                          id="text"
                          title=""
                          class="style-scope ytd-channel-name"
                          ellipsis-truncate=""
                          >The Office</yt-formatted-string
                        >
                      </div>
                      <tp-yt-paper-tooltip
                        fit-to-visible-bounds=""
                        class="style-scope ytd-channel-name"
                        role="tooltip"
                        tabindex="-1"
                        ><!--css-build:shady-->
                        <div
                          id="tooltip"
                          class="hidden style-scope tp-yt-paper-tooltip"
                        >
                          The Office
                        </div>
                      </tp-yt-paper-tooltip>
                    </div>
                    <ytd-badge-supported-renderer
                      class="style-scope ytd-channel-name"
                      system-icons=""
                      ><!--css-build:shady-->
                      <div
                        class="badge badge-style-type-verified style-scope ytd-badge-supported-renderer"
                        aria-label="Verified"
                      >
                        <yt-icon
                          class="style-scope ytd-badge-supported-renderer"
                          ><svg
                            viewBox="0 0 24 24"
                            preserveAspectRatio="xMidYMid meet"
                            focusable="false"
                            class="style-scope yt-icon"
                            style="
                              pointer-events: none;
                              display: block;
                              width: 100%;
                              height: 100%;
                            "
                          >
                            <g class="style-scope yt-icon">
                              <path
                                d="M12,2C6.5,2,2,6.5,2,12c0,5.5,4.5,10,10,10s10-4.5,10-10C22,6.5,17.5,2,12,2z M9.8,17.3l-4.2-4.1L7,11.8l2.8,2.7L17,7.4 l1.4,1.4L9.8,17.3z"
                                class="style-scope yt-icon"
                              ></path>
                            </g></svg
                          ><!--css-build:shady--></yt-icon
                        >
                        <span
                          class="style-scope ytd-badge-supported-renderer"
                        ></span>
                        <tp-yt-paper-tooltip
                          position="top"
                          class="style-scope ytd-badge-supported-renderer"
                          role="tooltip"
                          tabindex="-1"
                          ><!--css-build:shady-->
                          <div
                            id="tooltip"
                            class="hidden style-scope tp-yt-paper-tooltip"
                          >
                            Verified
                          </div>
                        </tp-yt-paper-tooltip>
                      </div>
                      <dom-repeat
                        id="repeat"
                        as="badge"
                        class="style-scope ytd-badge-supported-renderer"
                        ><template is="dom-repeat"></template
                      ></dom-repeat>
                    </ytd-badge-supported-renderer>
                  </ytd-channel-name>
                  <div id="separator" class="style-scope ytd-video-meta-block">
                    â€¢
                  </div>
                </div>
                <div
                  id="metadata-line"
                  class="style-scope ytd-video-meta-block"
                >
                  <span class="style-scope ytd-video-meta-block">6M views</span>

                  <span class="style-scope ytd-video-meta-block"
                    >2 years ago</span
                  >
                  <dom-repeat
                    strip-whitespace=""
                    class="style-scope ytd-video-meta-block"
                    ><template is="dom-repeat"></template
                  ></dom-repeat>
                </div>
              </div>
              <div
                id="additional-metadata-line"
                class="style-scope ytd-video-meta-block"
              >
                <dom-repeat class="style-scope ytd-video-meta-block"
                  ><template is="dom-repeat"></template
                ></dom-repeat>
              </div>
            </ytd-video-meta-block>
            <ytd-badge-supported-renderer
              class="badges style-scope ytd-compact-video-renderer"
              disable-upgrade=""
              hidden=""
            >
            </ytd-badge-supported-renderer>
          </div>
        </a>
        <div id="buttons" class="style-scope ytd-compact-video-renderer"></div>
      </div>
      <div id="menu" class="style-scope ytd-compact-video-renderer">
        <ytd-menu-renderer class="style-scope ytd-compact-video-renderer"
          ><!--css-build:shady-->
          <div
            id="top-level-buttons-computed"
            class="top-level-buttons style-scope ytd-menu-renderer"
          ></div>
          <div
            id="flexible-item-buttons"
            class="style-scope ytd-menu-renderer"
          ></div>
          <yt-icon-button
            id="button"
            class="dropdown-trigger style-scope ytd-menu-renderer"
            ><!--css-build:shady--><button
              id="button"
              class="style-scope yt-icon-button"
              aria-label="Action menu"
            >
              <yt-icon class="style-scope ytd-menu-renderer"
                ><svg
                  viewBox="0 0 24 24"
                  preserveAspectRatio="xMidYMid meet"
                  focusable="false"
                  class="style-scope yt-icon"
                  style="
                    pointer-events: none;
                    display: block;
                    width: 100%;
                    height: 100%;
                  "
                >
                  <g class="style-scope yt-icon">
                    <path
                      d="M12,16.5c0.83,0,1.5,0.67,1.5,1.5s-0.67,1.5-1.5,1.5s-1.5-0.67-1.5-1.5S11.17,16.5,12,16.5z M10.5,12 c0,0.83,0.67,1.5,1.5,1.5s1.5-0.67,1.5-1.5s-0.67-1.5-1.5-1.5S10.5,11.17,10.5,12z M10.5,6c0,0.83,0.67,1.5,1.5,1.5 s1.5-0.67,1.5-1.5S12.83,4.5,12,4.5S10.5,5.17,10.5,6z"
                      class="style-scope yt-icon"
                    ></path>
                  </g></svg
                ><!--css-build:shady--></yt-icon
              ></button
            ><yt-interaction
              id="interaction"
              class="circular style-scope yt-icon-button"
              ><!--css-build:shady-->
              <div class="stroke style-scope yt-interaction"></div>
              <div
                class="fill style-scope yt-interaction"
              ></div></yt-interaction></yt-icon-button
        ></ytd-menu-renderer>
      </div>
      <div
        id="queue-button"
        class="style-scope ytd-compact-video-renderer"
      ></div>
    </div>
  </div>
  <div id="dismissed" class="style-scope ytd-compact-video-renderer"></div>
  <yt-interaction
    id="interaction"
    class="extended style-scope ytd-compact-video-renderer"
    ><!--css-build:shady-->
    <div class="stroke style-scope yt-interaction"></div>
    <div class="fill style-scope yt-interaction"></div
  ></yt-interaction>
</ytd-compact-video-renderer>
